import React from 'react'
import PropTypes from 'prop-types'

const HttpTable = ({data}) => {

    const output = data.map( info => (
        <tr key={info._id}>
            <th>{info.status}</th>
            <td>{info.response}</td>
        </tr>
    ))

    return (
        <div className="">
            <table className="px-4">
                <tbody className="text-xs ">
                    {output}
                </tbody>
            </table>

        </div>
    )
}

HttpTable.propTypes = {

}

export default HttpTable
